import {
	ADD_FACE_BOX,
	ON_INPUT_CHANGE
} from './constants.js'

export const addFaceBox = (box) => ({
	type: ADD_FACE_BOX,
	payload: box
})

export const inputChange = (input) => ({
	type: ON_INPUT_CHANGE,
	payload: input
})
